# 제출 코드 - Runtime 7.67 Memory 100
class Solution:
    def validPalindrome(self, s: str) -> bool:
        first = self.onewayChecker(s, "r")
        if first == True:
            return True

        second = self.onewayChecker(s, "l")
        if second == True:
            return True

        return False

    def onewayChecker(self, s, fwd):
        end = len(s) - 1
        aaa = []
        leftIdx = 0
        rightIdx = 0

        while leftIdx <= len(s) // 2:
            if s[leftIdx] == s[end - rightIdx]:
                leftIdx += 1
                rightIdx += 1
                continue
            else:
                if len(aaa) == 0:
                    aaa.append(s[leftIdx])
                    if fwd == "r":
                        leftIdx += 1
                    elif fwd == "l":
                        rightIdx += 1
                else:
                    return False

        if s == s[::-1] or len(aaa) == 1:
            return True
        else:
            return False

# 테스트 데이터
sample1 = ""
